import React from 'react';
import './PopupCard.css';

const PopupCard = ({ title, description, imgUrl, detailedPageUrl }) => {
    return (
        <div className="popup-card">
            <img src={imgUrl} alt={title} className="card-image" />
            <h3>{title}</h3>
            <p>{description}</p>
            <a href={detailedPageUrl} target="_blank" rel="noopener noreferrer">
                More details
            </a>
        </div>
    );
};

export default PopupCard;
